import Axios from "axios";
import { useState, useEffect } from "react";
import React from 'react'
const desayuno =[]
const comida = []
function UseProducts() {
  const [products, setProducts] = useState([]);
  useEffect(() => {
    Axios({
      url: "http://localhost:4000/products",
    })
      .then((response) => {
       desayuno.push(setProducts(response.data.desayuno));
       comida.push(setProducts(response.data.comida));
      })
      .catch((error) => {
        console.log(error);
      });
  }, [setProducts]);
  return (products)
}

export default UseProducts
